// Secret.js
import React from 'react';
import { useSecret } from './SecretContext';

const Secret = () => {
  const { secrets } = useSecret();

  return (
    <div>
      <h2>Secret Descriptions</h2>
      <ul>
        {Object.keys(secrets).map((key) => (
          <li key={key}>
            <strong>{key}:</strong> {secrets[key].description}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Secret;
